import React from "react";

export function InfoUsuarios(props) {

    const objeto = {
       titulo: "Video 1",
       autor: "Mailson",
    }
    return (
        <>
            <h2>{props.objeto.nome}</h2>
            <ul>
                <li>Cor: {props.objeto.titulo}</li>
                <li>Ano: {props.objeto.autor}</li>
            </ul>
        </>
    )
    }
